import React, { useState, useEffect, useCallback } from 'react';
import { Link } from 'react-router-dom';
import { getAdmissionScores } from '../services/admissionScoreService';
import '../styles/pages/search-scores.css';

const SearchScoresPage = () => {
    const [filters, setFilters] = useState({
        examGroup: 'all',
        scoreRange: 'all',
        region: 'all',
        year: '2024',
        page: 1,
    });
    const [scores, setScores] = useState([]);
    const [pagination, setPagination] = useState({
        currentPage: 1,
        totalPages: 1,
        totalItems: 0,
        itemsPerPage: 20,
    });
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);

    const fetchScores = useCallback(async () => {
        try {
            setLoading(true);
            setError(null);
            console.log('Fetching with filters:', filters);
            const response = await getAdmissionScores(filters);
            console.log('Got response:', response);
            setScores(response.data || []);
            setPagination(response.pagination || {
                currentPage: 1,
                totalPages: 1,
                totalItems: 0,
                itemsPerPage: 20
            });
        } catch (err) {
            console.error('Error in component:', err);
            setError(err.message);
            setScores([]);
        } finally {
            setLoading(false);
        }
    }, [filters]);

    useEffect(() => {
        fetchScores();
    }, [fetchScores]);

    const handleFilterChange = (field, value) => {
        setFilters((prev) => ({
            ...prev,
            [field]: value,
        }));
    };

    const handleApplyFilters = () => {
        fetchScores();
    };

    const handlePageChange = (newPage) => {
        setFilters((prev) => ({
            ...prev,
            page: newPage,
        }));
    };

    return (
        <div className="ss-page">
            <section className="search-header">
                <h1>Tra cứu điểm chuẩn</h1>
                <p>Thông tin điểm chuẩn các trường qua các năm</p>
            </section>

            <div className="ss-content">
                <div className="ss-grid">
                    <aside className="filter-panel">
                        <h3>Bộ lọc tìm kiếm</h3>
                        <div className="filter-group">
                            <label>Khối thi</label>
                            <select
                                value={filters.examGroup}
                                onChange={(e) =>
                                    handleFilterChange(
                                        'examGroup',
                                        e.target.value,
                                    )
                                }
                            >
                                <option value="all">Tất cả khối</option>
                                <option value="A00">A00 (Toán, Lý, Hóa)</option>
                                <option value="A01">A01 (Toán, Lý, Anh)</option>
                                <option value="D01">
                                    D01 (Toán, Văn, Anh)
                                </option>
                            </select>
                        </div>
                        <div className="filter-group">
                            <label>Mức điểm</label>
                            <select
                                value={filters.scoreRange}
                                onChange={(e) =>
                                    handleFilterChange(
                                        'scoreRange',
                                        e.target.value,
                                    )
                                }
                            >
                                <option value="all">Tất cả</option>
                                <option value="above25">Trên 25 điểm</option>
                                <option value="20to25">20 - 25 điểm</option>
                                <option value="15to20">15 - 20 điểm</option>
                            </select>
                        </div>
                        <div className="filter-group">
                            <label>Khu vực</label>
                            <select
                                value={filters.region}
                                onChange={(e) =>
                                    handleFilterChange('region', e.target.value)
                                }
                            >
                                <option value="all">Toàn quốc</option>
                                <option value="north">Miền Bắc</option>
                                <option value="central">Miền Trung</option>
                                <option value="south">Miền Nam</option>
                            </select>
                        </div>
                        <div className="filter-actions">
                            <button
                                className="filter-apply-btn"
                                onClick={handleApplyFilters}
                            >
                                Áp dụng bộ lọc
                            </button>
                        </div>
                    </aside>

                    <div className="ss-scores-panel">
                        {loading ? (
                            <div className="loading-state">Đang tải dữ liệu...</div>
                        ) : error ? (
                            <div className="error-state">
                                <p>{error}</p>
                                <button 
                                    className="retry-btn"
                                    onClick={fetchScores}
                                >
                                    Thử lại
                                </button>
                            </div>
                        ) : (
                            <>
                                <div className="ss-scores-header">
                                    <div className="year-filter">
                                        {[2024, 2023, 2022, 2021, 2020].map((year) => (
                                            <button
                                                key={year}
                                                className={
                                                    filters.year === year.toString()
                                                        ? 'active'
                                                        : ''
                                                }
                                                onClick={() =>
                                                    handleFilterChange(
                                                        'year',
                                                        year.toString(),
                                                    )
                                                }
                                            >
                                                {year}
                                            </button>
                                        ))}
                                    </div>
                                    <div className="total-results">
                                        Tổng số kết quả: <strong>{pagination.totalItems}</strong>
                                    </div>
                                </div>

                                <table className="ss-scores-table">
                                    <thead>
                                        <tr>
                                            <th>Trường</th>
                                            <th>Mã trường</th>
                                            <th>Ngành học</th>
                                            <th>Khối thi</th>
                                            <th>Điểm chuẩn</th>
                                            <th>Chỉ tiêu</th>
                                        </tr>
                                    </thead>
                                    <tbody>
                                        {scores.map((score, index) => (
                                            <tr key={score._id || index}>
                                                <td>
                                                    <Link
                                                        to={`/school/${score.universityCode}`}
                                                        className="school-link"
                                                    >
                                                        {score.universityName}
                                                    </Link>
                                                </td>
                                                <td>{score.universityCode}</td>
                                                <td>{score.majorName}</td>
                                                <td>{score.examGroup}</td>
                                                <td className="score-value">
                                                    {score.score}
                                                </td>
                                                <td>{score.quota}</td>
                                            </tr>
                                        ))}
                                    </tbody>
                                </table>

                                <div className="pagination">
                                    <button 
                                        className="pagination-btn"
                                        disabled={pagination.currentPage === 1}
                                        onClick={() => handlePageChange(pagination.currentPage - 1)}
                                    >
                                        Trước
                                    </button>

                                    {Array.from({ length: pagination.totalPages }, (_, i) => (
                                        <button
                                            key={i + 1}
                                            className={`pagination-btn ${
                                                pagination.currentPage === i + 1 ? 'active' : ''
                                            }`}
                                            onClick={() => handlePageChange(i + 1)}
                                        >
                                            {i + 1}
                                        </button>
                                    ))}

                                    <button 
                                        className="pagination-btn"
                                        disabled={pagination.currentPage === pagination.totalPages}
                                        onClick={() => handlePageChange(pagination.currentPage + 1)}
                                    >
                                        Sau
                                    </button>
                                </div>
                            </>
                        )}
                    </div>
                </div>
            </div>
        </div>
    );
};

export default SearchScoresPage;
